from turtle import *

def bogen():
    for i in range(10):
        forward(10)
        left(9)

def blumenblatt():
    fillcolor('red')
    pencolor('red')
    begin_fill()
    for i in range(2):
        bogen()
        left(90)
    end_fill()

def blume():
    for i in range(5):
        blumenblatt()
        left(72)

blume()
